const Brand = () => {
    return (
        <brand>
            <div className='flex mb-[93px]'>
              <img data-aos="zoom-in-left" data-aos-duration="3000" data-aos-easing="ease-in-out"
                 className='lg:h-100 lg:w-[1000px] h-50 w-70' src='https://media.istockphoto.com/id/1139069245/photo/beautiful-young-woman-sitting-on-the-floor-with-crossed-legs-using-laptop-relax-and-smiling.webp?a=1&b=1&s=612x612&w=0&k=20&c=pIj4vibdSkBv2dIooxRkBBRobxxfs0ocOgngGujopq8=' alt=''/>
              <img data-aos="zoom-in-right" data-aos-duration="3000" data-aos-easing="ease-in-out"
                className='lg:h-100 lg:w-[1000px] h-50 w-70' src='https://images.unsplash.com/file-1635990775102-c9800842e1cdimage?w=416&dpr=2&auto=format&fit=crop&q=60' alt=''/>
           </div>
        </brand>
    )
}
export default Brand;
